import React, { useState } from 'react';
import AlertMobile from './Components/AlertMobile';
import ParticlesBg from 'particles-bg';
import Navigation from './Components/Navigation';
import { Container } from 'react-bootstrap';
import './App.css';
import MainContent from './Components/MainContent';

function App() {

    const [navSelected, setNavSelected] = useState('home');

    return (
      <Container>
        <ParticlesBg style={{zIndex: 1}} type="cobweb" bg={true} />
        <AlertMobile />
        <Navigation navSelected = {navSelected} setNavSelected = {setNavSelected} />
        <MainContent navSelected = {navSelected} setNavSelected = {setNavSelected} />
      </Container>
    );
}

export default App;
